import React from 'react';
import RoomItem from './Room';

function RoomContainer( {indRooms, onDeleteRoom}) {
    const RoomItems = rooms.map((room) => (
        <RoomItem
            key={room.id}
            room={room}
            onDeleteRoom={onDeleteRoom}
        />
    ));

    return (
        <section>
            <h1>Rooms</h1>
            {RoomItems}
        </section>
    );
}

export default RoomContainer;
